import React from 'react'
import Delete from '@material-ui/icons/Delete'
import { useCart, useDispatchCart } from '../components/ContextReducer';
import { useOrder, useDispatchOrder } from '../components/ContextReducerForAdmin';
import Navbar from '../components/Navbar';
import ShoppingCartIcon from "@material-ui/icons/ShoppingCart";
import { useNavigate } from 'react-router-dom';
import Footer from '../components/Footer';
export default function Cart() {
  let navigate = useNavigate()
  let data = useCart();
  let dispatch = useDispatchCart();
  const dispatchord = useDispatchOrder();
  if (data.length === 0) {
    return (<>
    <div><Navbar/></div>
      <div className='bg-white'>
        <div className='m-5 w-100 text-center fs-3'>The Cart is Empty!</div>
      </div>
      <div><Footer/></div>
      </>
    )
  }

  const handleCheckOut = async () => {
    let userEmail = localStorage.getItem("userEmail");
    
    // console.log(data,localStorage.getItem("userEmail"),new Date())
    let response = await fetch("http://localhost:5000/api/auth/gyjorderData", {
      // credentials: 'include',
      // Origin:"http://localhost:3000/login",
      method: 'POST',
      headers: {
        'Content-Type': 'application/json'
      },
      body: JSON.stringify({
        order_data: data,
        email: userEmail,
        order_date: new Date().toDateString()
      })
    });
    console.log("JSON RESPONSE:::::", response.status)
    if (response.status === 200) {
      dispatch({ type: "DROP" })
    }
  }

  const placeOrder = async () => {
    
    let food = []
    for (const item of data) {
      if (item.id === food.id) {
        food = item;

        break;
      }
    }
    console.log(food)
    console.log(new Date())
    //food !== []
    await dispatchord({ type: "ADD", id: food.id, name: food.name, price: totalPrice, qty: food.qty, category:food.category, save:food.save, dealer:food.dealer  })
  }
  
  let totalPrice = data.reduce((total, food) => total + food.price, 0)
  return (
    <>
      <div>
        <Navbar />
      </div>
      <div className='bg-white w-100'>
        <div className="bg-white text-secondary h1 text-center mt-3" >
          <ShoppingCartIcon />
          Cart
        </div>

        {console.log(data)}
        <div className='container m-auto mt-2 table-responsive  table-responsive-sm table-responsive-md' >
          <table className='table table-hover '>
            <thead className=' text-secondary fs-4'>
              <tr className='bg-white'>
                <th scope='col' >#</th>
                <th scope='col' >Name</th>
                <th scope='col' >Quantity</th>
                <th scope='col' >Amount</th>
                <th scope='col' >Delete</th>
              </tr>
            </thead>
            <tbody>
              {data.map((food, index) => (
                <tr>
                  <th scope='row' >{index + 1}</th>
                  <td >{food.name}</td>
                  <td>{food.qty}</td>
                  <td>{food.price}</td>
                  <td ><button type="button" className="btn p-0"><Delete onClick={() => { dispatch({ type: "REMOVE", index: index }) }} /></button> </td>
                </tr>
              ))}
            </tbody>
          </table>
          <div><h1 className='fs-2'>Total Price: {totalPrice}/-</h1></div>
          <div>
            <button className='btn btn-outline-secondary mt-4 mb-5' onclick="handleCheckOut(); placeOrder()" > Check Out </button>
            <button className={`btn btn-outline-secondary m-5`} onClick={() => navigate("/vieworders")}>View Orders</button>
            
          </div>
        </div>
      </div>
      <Footer/>
    </>
  )
}
